import LaptopImg from "computer-1185626_1280.jpeg";

const RegisterAd = () => {
  return (
    <div className="register-ad-container">
      <div className="take-back-section">
        <h1>Take Back What's Yours</h1>
        <p>
          File your taxes with us today by scheduling a session with one of our
          tax professionals.
        </p>
        <button>Register Now</button>
      </div>
      <img src="" alt="img" />
    </div>
  );
};
export default RegisterAd;
